import React from "react";

const curHr = new Date().getHours();

function GoodMorn() {
  let greeting = "";
  const cssStyle = {};
  if (curHr < 12) {
    greeting = "Good Morning";
    cssStyle.color = "green";
  }

  return (
    <>
      <div>
        <h1>
          Hello Sir, <span style={cssStyle}> {greeting}</span>{" "}
        </h1>
      </div>
    </>
  );
}

export default GoodMorn;
